**Fixed Code Snippet**
```java
// This code snippet is secure against SQL injection attacks
import java.sql.*;

public class SecureCode {
    public static void main(String[] args) {
        // Create a connection to the database
        Connection conn = DriverManager.getConnection("jdbc:mysql://localhost:3306/mydb", "username", "password");

        // Create a prepared statement object
        PreparedStatement pstmt = conn.prepareStatement("SELECT * FROM users WHERE username =? AND password =?");

        // Get user input
        String username = "admin";
        String password = "password";

        // Set the parameters of the prepared statement
        pstmt.setString(1, username);
        pstmt.setString(2, password);

        // Query the database with the prepared statement
        ResultSet rs = pstmt.executeQuery();

        // Print the results
        while (rs.next()) {
            System.out.println(rs.getString("username"));
        }

        // Close the connection
        conn.close();
    }
}
```

In the vulnerable code snippet, the user input is directly concatenated into the SQL query, making it vulnerable to SQL injection attacks. An attacker could inject malicious SQL code by entering a specially crafted input, potentially leading to unauthorized data access or modification.

In the fixed code snippet, a prepared statement is used to separate the SQL code from the user input. The `?` placeholders in the SQL query are replaced with the actual values using the `setString()` method, preventing any malicious input from being executed as SQL code.

