```

This schema includes the following properties:

- `id`: a unique identifier for the beta cruiser
- `name`: the name of the beta cruiser
- `model`: the model of the beta cruiser
- `year`: the year of manufacture
- `speed`: the top speed of the beta cruiser
- `engines`: a list of engines, each with a `type` and `power` property
- `armament`: a list of armaments, each with a `type` and `caliber` property
- `crew`: an object with a `commander` property and an `officers` array

Note that the `engines` and `armament` properties are arrays, and each item in these arrays is an object with its own properties. The `crew` property is an object with a `commander` property and an `officers` array.

